def deep_unmix(data, k1, k2, k3, k4):
    data = unmix2(data, k4)
    data = unmix1(data, k3)
    for _ in range(6):
        data = base64.b64decode(data)
    data = unmix3(data)
    data = unmix2(data, k2)
    return unmix1(data, k1)
